import React from 'react';
import CardStyle from './CardStyle'; // Asegúrate de que el nombre del archivo sea correcto

function CardList({ Datas, Loading, setCartArticle }) {
  if (Loading) {
    return <div>Loading...</div>;
  }

  return (
    <div>
      {Datas.map((item) => (
        <CardStyle key={item.id} person={item} setCartArticle={setCartArticle} />
      ))}
    </div>
  );
}

export default CardList;
